import React from 'react'
import logo1 from '../images/logo1.jpg'
export default function Header() {
  return (
    <div className='d-flex p-2 '>
           <div className='justify-content-center'>
            <img src={logo1} alt="" />
           </div>
      
    </div>
  )
}
